window.bookSummaryJSON = "<p>Surrounded by enemies, I've never been further from my crown…</p> <p>Or closer to death.</p> <p>Amidst a betrayal we couldn't have anticipated, I'll do whatever it takes to find my way back to Lorian—before his fury lays waste to this continent.</p> <p>Alliances are being forged and broken, our enemies are unifying, and Regner’s spiders are closer than ever before.</p> <p>We have only one chance to prevent him from attaining god-like powers and enslaving every human, fae, and hybrid across the four kingdoms. </p> <p>Meanwhile, the human king believes I’m trapped here, yearning for my death, and waiting for Lorian to save me. </p> <p>But Regner hasn’t yet realized that I'll stop at nothing to free my people. </p> <p>And he's the one who should be afraid of me.</p>"; 
